The TOSSIM abstraction of a mote. By putting simulation state into
a component, we can scale and reference this state automatically
using nesC's rewriting, rather than managing and indexing into
arrays manually.

@author Phil Levis
@date   August 19 2005

Components should never wire to this component. This is the
underlying configuration of virtualized millisecond timers. 
It auto-wires wires the timer
implementation (TimerC) to the boot sequence and exports the
various Timer interfaces.

@author Philip Levis
@author Cory Sharp
@date   May 16 2005

Millisecond timer for the mica family (see TEP102). The "millisecond"
timer system is built on hardware timer 0, running at 1024Hz.

@author Cory Sharp <cssharp@eecs.berkeley.edu>
@author Martin Turon <mturon@xbow.com>

Build a 32-bit alarm and counter from the atmega128's 8-bit timer 0 in asynchronous mode. Attempting to use the generic Atm128AlarmC component and the generic timer components runs into problems apparently related to letting timer 0 overflow.
So, instead, this version (inspired by the 1.x code and a remark from Martin Turon) directly builds a 32-bit alarm and counter on top of timer 0 and never lets timer 0 overflow.
@author David Gay

Build a 32-bit alarm and counter from the atmega128's 8-bit timer 0 in asynchronous mode. Attempting to use the generic Atm128AlarmC component and the generic timer components runs into problems apparently related to letting timer 0 overflow.
